import "./App.css";
import Video from "./pages/Video";

function App() {
  return (
    <div className="App">
      <div className="app_videos">
        <Video 
          likes={100} 
          messages={200} 
          shares={300}
          name="José"
          description="Gato goleiro"
          musica="Música épica"
          />
        <Video 
          likes={100} 
          messages={200} 
          shares={300}
          name="Maria"
          description="Gato goleiro 2"
          musica="Música épica"
        />
        <Video />
        <Video />
        <Video />
      </div>
    </div>
  );
}

export default App;
